class Solution:
    def findMaxAverage(self, nums: list, k: int) -> float:
        lst = []
        lst.extend(nums[:k])
        max_avg = sum(lst) / k

        for i in range(k, len(nums)):
            del lst[0]
            lst.append(nums[i])

            cur_avg = sum(lst) / k
            max_avg = max(cur_avg, max_avg)

        return max_avg



